import React from "react";
import { Link } from "react-router-dom";

const Header = ({ isAuthenticated, onLogout }) => {
  return (
    <header className="bg-gray-800 text-white p-4 shadow-md">
      <div className="flex justify-between items-center"> {/* Flexbox for left and right items */}
        
        {/* Left Section: Logo and Header Text */}
        <div className="flex items-center space-x-4">
          <img src="../assets/logo.png" alt="Logo" className="w-16 h-16" /> {/* Logo */}
          <h1 className="text-xl font-bold">Project Manager</h1>
        </div>

        {/* Right Section: Navigation Links */}
        <nav>
          <ul className="flex space-x-6">
            <li>
              <Link to="/" className="hover:text-gray-400">Home</Link>
            </li>
            <li>
              <Link to="/contact-us" className="hover:text-gray-400">Contact Us</Link>
            </li>
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default Header;
